// 还能调优应该
std::string longestCommonPrefix(std::vector<std::string> &strs)
{
    std::string ret = strs[0];
    int sz = strs.size();
    int q;

    for (size_t i = 1; i < sz; i++)
    {
        q = 0;
        while (true)
        {
            if (q == (int)ret.size())
            {
                break;
            }

            if (ret[q] == strs[i][q])
            {
                q++;
            }
            else
            {
                ret = ret.substr(0, q);
                break;
            }
        }
    }

    return ret;
}

